import React from 'react';
import Editor from '@monaco-editor/react';

const CodeEditor = ({ code, setCode }) => {
  return (
    <Editor
      height="60vh"
      defaultLanguage="python"
      value={code}
      onChange={setCode}
      theme="vs-dark"
    />
  );
};

export default CodeEditor;
